MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The Calibre Metrology Interface (CMi) is a CalibreWORKbench-based tool created as a design-based off-line marking system for SEM measurements. Use CMi to graphically enter sites and generate a target list in a number of different metrology machine formats.");
MGCAddSnippet(5, "The two major inputs to CMi are measurement locations and the mask layout. The sources of measurement locations are varied. For example, tools like CalibreOPCverify may identify  hot-spot  locations from analysis of the layout, or designers may pass on layout knowledge in a written list of coordinates. ");
MGCAddSnippet(6, "The Calibre Metrology tool is used interactively with other Calibre tools.");
MGCAddSnippet(7, "Prior to using the Calibre Metrology Interface, there are several prerequisites.");
MGCAddSnippet(8, "The Calibre Metrology Interface contains a number of operations to support SEM measurements and design-based off-line marking.");
MGCAddSnippet(9, "The basic workflow for the Calibre Metrology Interface uses CMi in conjunction with Calibre WORKbench (or Calibre MDPview) to graphically enter sites and generate a target list in different metrology machine formats.");
MGCAddSnippet(10, "You can save the current state of your Calibre Metrology Interface session and reload it at any time. This enables you to restore the exact state of your work at the point that you save. ");
MGCAddSnippet(11, "Job specification (jobspec) files are Tcl files that contain parameters for Calibre Metrology Interface runs. These were utilized by previous versions of CMi and are now maintained for backwards compatibility. They are no longer required as the same information is now saved in a CMi session file instead.");
MGCAddSnippet(12, "An optional step in the Calibre Metrology Interface is to add a chip to your mask layout for assembly.");
MGCAddSnippet(13, "You can add a chip to your mask layout in the Calibre Metrology Interface using the Tools > Assemble Jobdeck option.");
MGCAddSnippet(14, "The Calibre Metrology Interface enables you to set the tonality of the measured layer formats. Layer tonality specifies if the polygon defines a feature (width) or a space. This is needed to correctly assign an MP Template name in the Hitachi HSS CSV format.");
MGCAddSnippet(15, "This section describes marker-based operations in the Calibre Metrology Interface.");
MGCAddSnippet(16, "Graphical markers can be drawn in any of the layout files which are assembled by CMi. They may be drawn in any hierarchical cell.");
MGCAddSnippet(17, "For hierarchical markers, when you add a marker in a cell that is not the TOP cell, the Calibre Metrology Interface automatically identifies it s position in the hierarchy. ");
MGCAddSnippet(18, "You can use the Calibre Metrology Interface to adjust the parameters for your markers.");
MGCAddSnippet(19, "You can reload preexisting markers in CMi as part of an error recovery function. For example, you accidentally imported markers to an incorrect layout file and you need to import the same marker list to another layout file instead. ");
MGCAddSnippet(20, "You can import markers from a number of different sources.");
MGCAddSnippet(21, "You can export marker information in CMi in various formats.");
MGCAddSnippet(22, "You can delete existing markers using CMi.");
MGCAddSnippet(23, "The marker position and size can be adjusted by the drag method in the layout window. This is an alternative to directly editing the marker properties in the Sites table. More care is required here to maintain the text object within the marker shape. Layout changes will not reflect in the Sites table until after generating CMi output. Generally, the other methods are preferred.");
MGCAddSnippet(24, "The SEM magnification is controlled individually for Markers with algorithm values of  Image ,  Contour , or  Group . The size of these markers indicates the SEM field-of-view. ");
MGCAddSnippet(25, "When you run CMi to confirm the validity of markers for measurements, the tool automatically detects and display the failed markers.");
MGCAddSnippet(26, "You can use the CMi interface to browse for failed markers.");
MGCAddSnippet(27, "You can specify the marker extent for the SEM measurement method. The markers are used to align the SEM pattern recognition region.");
MGCAddSnippet(28, "Multiple measurements can be made from a single marker using the Kind property. This feature is only available for the AMAT SEM format. ");
MGCAddSnippet(29, "The CSV format is a general-purpose interface for measurement sites. It is available for both input and output and can be easily created and modified with a text editor, spreadsheet program, or user software.");
MGCAddSnippet(30, "The Calibre Metrology Interface supports a number of measurement-based operations.");
MGCAddSnippet(31, "The CMi Capture Field represents the SEM field-of-view. Multiple measurements can be grouped into a single field to reduce the run time on the tool and prevent over scanning. The user designates the grouping by one of two methods: a Group Marker or a Region.");
MGCAddSnippet(32, "Measurements can be designated to be in groups that are defined by rectangular regions of the layout. these regions can be specified in the input layout or CSV file, in which case they will be rendered in the layout after assembly. ");
MGCAddSnippet(33, "Regions can be drawn into the layout after assembly. The specified Region Layer number is used. Region names may be edited as text within the rectangle on the same layer. Hierarchical regions are allowed.");
MGCAddSnippet(34, "An iterative method may be used to configure multiple measurements.");
MGCAddSnippet(35, "If tolerance is given in a CSV table for a Marker, then it is used for Measurements from that Marker. If the Marker has no tolerance (including drawn markers), then the default value for the job is used.");
MGCAddSnippet(36, "Commonly, the target_value is taken from the feature size on the specified  Measure Layer . ");
MGCAddSnippet(37, "Searches are defined in the CSV input table. An output table can be used as a template for the proper object header and property names. One search requires an object for each of the following: search, feature spec, and region. ");
MGCAddSnippet(38, "Searches are specified only from a CSV file.");
MGCAddSnippet(39, "You can use CMi to manually set magnification settings for different parameters for Hitachi output (more specifically, the EP_MAG_SCAN_X and GP_Data values in the HSS CSV file). ");
MGCAddSnippet(40, "In CMi, you can define boolean operations more than any two layers from the original layers in the layout or from derived intermediate layers from previous boolean operations.");
MGCAddSnippet(41, "You can use the Calibre Metrology Interface to construct a complete square shape constructed from clips of the four corners of your layout, starting from the SEM/OM marker position. OM/SEM markers are typically positioned at the origin X1, Y1 of the layout (the lower left corner). The upper-right quarter of the clip is placed inside the design while the other three portions are placed outside and are empty. ");
MGCAddSnippet(42, "Wafer data is often used to complete SEM recipes for machine vendor middle-ware to speed up and enhance the metrology process cycle. You use CMi to generate or edit an existing wafer data XML file that includes wafer parameters needed to generate an AMAT DWM and Hitachi IDW file.");
MGCAddSnippet(43, "You can load SEM images in (.tiff) format and compare them to the design clip generated from CMi. You can also attach this image to a marker and the SEM image path is added to the output Marker points in the CSV file. This assists in diagnosis and verification of the validity of the model against what is printed on the wafer.");
MGCAddSnippet(44, "The Calibre Metrology Interface (CMi) is a tool that assists generation of correct and complete SEM machine recipes. The metrology algorithm is one of the setup parameters that must be defined per measurement location. ");
MGCAddSnippet(45, "The overall process of setting up automatic metrology algorithm identification can be summarized in two phases.");
MGCAddSnippet(46, "There are different methods available to build pattern matching libraries: using the DFM Pattern Capture command in a script, or use the Pattern Library Manager in Calibre WORKbench.");
MGCAddSnippet(47, "You can use the SVRF DFM Pattern Capture command that to create a library of patterns from a layout. Patterns can be captured either by defining a set of hotspots and a halo around the hotspot, or by defining a mask on a masking layer to define the extent of the pattern. ");
MGCAddSnippet(48, "You can create a pattern matching library using the Pattern Library Manager in Calibre WORKbench. ");
MGCAddSnippet(49, "Using either the DFM Pattern Capture command or the Pattern Matching Manager in Calibre WORKbench, you can create pattern libraries.");
MGCAddSnippet(50, "CMi users run the automatic algorithm identification flow by just selecting compiled encrypted SVRF version of the DMACRO pattern library.");
MGCAddSnippet(51, "A pattern library is a collection of one or more patterns created within the Pattern Library Manager or captured using one of the pattern capture operations. When the pattern library is filled with the patterns you want to search for and ready to be included in a pattern matching Calibre run, the pattern library is then exported from the Pattern Library Manager to create an SVRF DMACRO pattern file.");
MGCAddSnippet(52, "It is common to have a certain feature in the design to be matched with more than one pattern from the pattern library. Currently, CMi gets the first pattern matching result marker and assigns an algorithm according to the property attached to this pattern, ignoring the possibility of having different matches. CMi detects the existence of multi-match patterns and gives you the ability to manually select the algorithm value from the pattern matching results.");
MGCAddSnippet(53, "CMi can highlight markers with more than one algorithm identified during the automatic algorithm assignment process. You can then manually choose between the identified algorithms to assign to the marker.");
MGCAddSnippet(54, "The Calibre Metrology Interface enables you to define commands to resolve conflicts in algorithm identification for sites with multiple possible pattern matching results. You can define priority and preceding commands as well as visual classification of sites with similar algorithm combinations for manual resolution and verification of the solution.");
MGCAddSnippet(55, "The Calibre Metrology Interface uses Calibre s pattern matching capability to find the local alignment marker structures in the design, allowing you to prepare a pattern library that includes all the structures. CMi then prepares a layout from the original design, where it includes every measurement point within a clip of a size equal to the search region. In the case of having nearby measurement points on overlapped search regions, CMi can identify these situations to avoid missing the local alignment markers. The metrology process requires the definition of alignment markers; the local alignment markers are required to be close to the measurement points in the design for the SEM machine to correctly capture the feature.Typically, designers define a set of features or patterns that indicate the position of the local alignment markers. The process of manually identifying the position of local alignment markers in current designs can be a difficult and time-consuming process. The Calibre Metrology Interface enables you to automate the identification of these markers based on pre-defined structures. The local alignment mark is taken at the same magnification (or close to the same magnification) as for the measurement points. It must be close to the measurement and is done for all measurements, not just once for the entire wafer. ");
MGCAddSnippet(56, "The Calibre Metrology Interface enables you to define a single contact pattern that could be assigned multiple algorithm values according to the pattern size ratio to improve the consistency in recipe generation. This allows you to set the ratios and corresponding algorithms according to your own specifications.");
MGCAddSnippet(57, "You can use CMi to generate metrology recipes for sites in different chiplet placements. Chiplets are designs that utilize far smaller microscopic circuitry than currently used to create electronic components such as microprocessors and memory.");
MGCAddSnippet(58, "The Calibre Metrology Interface is a single GUI interface with several functional sections.");
MGCAddSnippet(59, "The Calibre Metrology Interface contains several functional regions to perform metrology operations. Show or hide the Machine Area and the SEM Diagnosis Tool by clicking on the arrow bar to the right of the Sites Table.");
MGCAddSnippet(60, "The Assemble Jobdeck Options dialog box contains controls for the Assembly operation.");
MGCAddSnippet(61, "The Layer Options section contains controls to define layer parameters for processing.");
MGCAddSnippet(62, "The Alignment Marker section contains controls to define parameters for automatic selection of alignment markers.");
MGCAddSnippet(63, "The Site Automatic Adjustment section defines parameters for automatic site parameter identification, including location and metrology algorithm.");
MGCAddSnippet(64, "The Site Size Preferences section defines the size preferences for sites. ");
MGCAddSnippet(65, "The Layer Options section contains controls to specify the output format for the Calibre Metrology Interface.");
MGCAddSnippet(66, "The Display Preferences section specifies the global visual display parameters for site markers, including window width and size.");
MGCAddSnippet(67, "The Sites table allows you to view and manage marker and site information in the layout. This includes the name, x-y position, size, orientation, width, target value, tolerance, algorithm, magnification, and cell used. ");
MGCAddSnippet(68, "The Layer Processor window enables you to define boolean operations on multiple layers (more than two) from the original layers in the layout or from derived intermediate layers from previous boolean operations. Prior to the Assemble for Review phase, this window will be empty. Following Assemble for Review, the input layer list will automatically be filled in. You can also load a previously saved session by clicking the Load button.");
MGCAddSnippet(69, "The Chiplets Manager enables you to create a metrology recipe for sites defined in multiple chiplets from a layout, so sites within a chip can be found in different placements in the design with different transformations.");
MGCAddSnippet(70, "The Algorithm Manager enables you to define custom names to the current default metrology algorithms used in a CMi flow. It also gives you the ability to add new custom metrology algorithm names and attach them to output AMAT and Hitachi algorithms.");
MGCAddSnippet(71, "The Extended Mask top cell and Chip top cell name fields have restrictions of the allowed characters.");
MGCAddSnippet(72, "Calibre Metrology Interface sessions can be configured through batch commands and Tcl functions. ");
MGCAddSnippet(73, "CMi executes custom Tcl scripts through the Calibre WORKbench layout viewer.");
MGCAddSnippet(74, "The Calibre Metrology Interface uses Tcl-based batch scripts that enable you to customize various tool behaviors including sessions, output, clip generation, and automatic algorithm identification.");
MGCAddSnippet(75, "The Calibre Metrology Interface supports Tcl-based batch commands used to create custom scripts to modify its operations.");
MGCAddSnippet(76, "Creates a new CMi session. ");
MGCAddSnippet(77, "Configures the CMi session with initial session parameters.");
MGCAddSnippet(78, "Loads a previously-defined session file into CMi.");
MGCAddSnippet(79, "Loads a previously defined CMi job configuration file in XML format.");
MGCAddSnippet(80, "Loads an XML wafer map session file in CMi.");
