MGCAddSnippet(85, "Retrieves the configuration object used for the sites filter configuration.");
MGCAddSnippet(86, "Retrieves the configuration object used for the local alignment locator.");
MGCAddSnippet(87, "Specifies adjustments for center, orientation, and feature types for sites.");
MGCAddSnippet(88, "Runs automatic algorithm identification for sites.");
MGCAddSnippet(89, "Generates CMi GDS or OASIS layout clips. ");
MGCAddSnippet(90, "Locates alignment marker sites as defined by a Tcl configuration object.");
MGCAddSnippet(91, "Loads a sample plan from different sources by defining the file format and the file path.");
MGCAddSnippet(92, "Output marker sites in AMAT format.");
MGCAddSnippet(93, "Outputs sites in CSV format.");
MGCAddSnippet(94, "Output marker sites in Hitachi format.");
